import Layout from "../components/Layout";

const Index = () => (
  <Layout>
    <div className = "container-fluid mainCon h-100">
      <div className = "row h-100 align-items-center">
        <div className = "col-lg-6">

        </div>
        <div className = "col-lg-6">
          <p>Book your delivery now!</p>
        </div>
      </div>
    </div>
  </Layout>
);

export default Index;
